/*****************************************************************************
 结构名    : REG_PD_ALERT_L_UNION
 结构说明  : PD_ALERT_L 寄存器结构定义。地址偏移量:0x10，初值:0x00，宽度:8
 寄存器说明: PD Alert Low
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  pd_int_ccstatus    : 1;  /* bit[0-0]: CC1/CC2状态发生变化
                                                             1b:CC Status发生变化的中断标识
                                                             0b:没有中断发生
                                                             注意：这里的CC1/CC2状态发生变化指的是PD_CC_STATUS的pd_cc1_stat/pd_cc2_stat。而pd_look4con与pd_con_result的变化不会触发中断
                                                             默认0 */
        unsigned char  pd_int_port_pwr    : 1;  /* bit[1-1]: Power Status（PD_PWR_STATUS寄存器）发生变化的中断标识
                                                             1b:Power Status发生变化中断
                                                             0b:没有中断发生
                                                             默认0 */
        unsigned char  pd_int_rxstat      : 1;  /* bit[2-2]: RX通道接收到SOP* Message中断标识。
                                                             1b:RX接收到SOP* Msg中断
                                                             0b:没有中断发生
                                                             注意：写1清除该中断后，TCPC会自动清除PD_RXBYTECNT，PD_RXTYPE，PD_RXHEAD，PD_RXDATA*，即RX BUFFER区域。
                                                             默认0 */
        unsigned char  pd_int_rxhardrst   : 1;  /* bit[3-3]: RX通道接收到Hard Reset中断标识。
                                                             1b:RX通道接收到Hard Reset中断发生
                                                             0b:没有中断发生
                                                             默认0 */
        unsigned char  pd_int_txfail      : 1;  /* bit[4-4]: TX通道发送失败中断标识（在CRCReceive时间内没有收到有效的GoodCRC）
                                                             1b:TX通道发送失败中断
                                                             0b:没有中断发生
                                                             默认0 */
        unsigned char  pd_int_txdisc      : 1;  /* bit[5-5]: TX通道发送被丢弃中断标识。当物理层正在发送数据；或正在接受数据；或TX成功，失败，丢弃中断没有清零；或RX成功，RX Hard Reset中断没有清零；或发送时候PD_TXBYTECNT为0的时候触发TRANSMIT，则发送数据会被丢弃。
                                                             
                                                             1b:TX通道发送被丢弃中断
                                                             0b:没有中断发生
                                                             默认0 */
        unsigned char  pd_int_txsucc      : 1;  /* bit[6-6]: TX通道发送成功中断标识
                                                             1b:TX通道发送成功中断
                                                             0b:没有中断发生
                                                             默认0 */
        unsigned char  pd_int_vbus_alrm_h : 1;  /* bit[7-7]: Vbus电压越过高电压阈值的中断标识。高电压阈值可以由寄存器PD_VALARMH_CFGL/H进行设置，另外需要提前开启HKADC以便采样Vbus电压。
                                                             1b:发生Vbus高电压中断
                                                             0b:没有中断发生
                                                             默认0 */
    } reg;
} REG_PD_ALERT_L_UNION;
#endif
#define REG_PD_ALERT_L_pd_int_ccstatus_START     (0)
#define REG_PD_ALERT_L_pd_int_ccstatus_END       (0)
#define REG_PD_ALERT_L_pd_int_port_pwr_START     (1)
#define REG_PD_ALERT_L_pd_int_port_pwr_END       (1)
#define REG_PD_ALERT_L_pd_int_rxstat_START       (2)
#define REG_PD_ALERT_L_pd_int_rxstat_END         (2)
#define REG_PD_ALERT_L_pd_int_rxhardrst_START    (3)
#define REG_PD_ALERT_L_pd_int_rxhardrst_END      (3)
#define REG_PD_ALERT_L_pd_int_txfail_START       (4)
#define REG_PD_ALERT_L_pd_int_txfail_END         (4)
#define REG_PD_ALERT_L_pd_int_txdisc_START       (5)
#define REG_PD_ALERT_L_pd_int_txdisc_END         (5)
#define REG_PD_ALERT_L_pd_int_txsucc_START       (6)
#define REG_PD_ALERT_L_pd_int_txsucc_END         (6)
#define REG_PD_ALERT_L_pd_int_vbus_alrm_h_START  (7)
#define REG_PD_ALERT_L_pd_int_vbus_alrm_h_END    (7)


/*****************************************************************************
 结构名    : REG_PD_ALERT_H_UNION
 结构说明  : PD_ALERT_H 寄存器结构定义。地址偏移量:0x11，初值:0x00，宽度:8
 寄存器说明: PD Alert High
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  pd_int_vbus_alrm_l   : 1;  /* bit[0-0]: Vbus电压越过低电压阈值的中断标识。低电压阈值可以由寄存器PD_VALARML_CFGL/H进行设置，另外需要提前开启HKADC以便采样Vbus电压。
                                                               1b:发生Vbus低电压中断
                                                               0b:没有中断发生
                                                               默认0 */
        unsigned char  pd_int_fault         : 1;  /* bit[1-1]: 有错误发生中断标识（Fault需要回读Fault Status寄存器去判断）
                                                               1b:错误发生中断，需要回读PD_FAULT_STATUS寄存器判断错误类型。
                                                               0b:没有中断发生
                                                               默认0 */
        unsigned char  pd_int_rx_full       : 1;  /* bit[2-2]: RX通道溢出中断标识。当接收数据的数据包长度超过最大长度（28Byte），则上报中断。
                                                               1b:RX buffer区域写满溢出，溢出后不会回GoodCRC给对端。
                                                               0b:没有中断发生
                                                               默认0
                                                               注意：对该比特进行写1不会清除该比特。需要写PD_ALERT_H寄存器的pd_int_rxstat为1，才能清该比特为0。
                                                               默认0 */
        unsigned char  pd_int_vbus_snk_disc : 1;  /* bit[3-3]: Vbus Sink拔除中断标识。需要配置PD_PWR_CTRL寄存器的pd_auto_disch为1开启自动放电；需要开启HKADC观察Vbus电压；需要设置拔出检测电压阈值PD_VBUS_SNK_DISCL/H。则当TCPC作为Snk的时候，对端拔出，Vbus电压降低至阈值以下则上报中断。
                                                               1b:Vbus Sink拔除中断发生
                                                               0b:没有中断发生
                                                               默认0 */
        unsigned char  reserved             : 3;  /* bit[4-6]: reserved */
        unsigned char  pd_int_fr_swap       : 1;  /* bit[7-7]: 协议外自定义中断。Fast Role Swap发生的中断标识。
                                                               1b:发生Fast Role Swap中断；
                                                               0b:没有中断发生
                                                               默认0 */
    } reg;
} REG_PD_ALERT_H_UNION;
#endif
#define REG_PD_ALERT_H_pd_int_vbus_alrm_l_START    (0)
#define REG_PD_ALERT_H_pd_int_vbus_alrm_l_END      (0)
#define REG_PD_ALERT_H_pd_int_fault_START          (1)
#define REG_PD_ALERT_H_pd_int_fault_END            (1)
#define REG_PD_ALERT_H_pd_int_rx_full_START        (2)
#define REG_PD_ALERT_H_pd_int_rx_full_END          (2)
#define REG_PD_ALERT_H_pd_int_vbus_snk_disc_START  (3)
#define REG_PD_ALERT_H_pd_int_vbus_snk_disc_END    (3)
#define REG_PD_ALERT_H_pd_int_fr_swap_START        (7)
#define REG_PD_ALERT_H_pd_int_fr_swap_END          (7)


