/*****************************************************************************
 结构名    : REG_PD_CC_STATUS_UNION
 结构说明  : PD_CC_STATUS 寄存器结构定义。地址偏移量:0x1D，初值:0x10，宽度:8
 寄存器说明: PD CC Status
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  pd_cc1_stat   : 2;  /* bit[0-1]: CC1通路状态，
                                                        当CC1为Rp上拉，则值为：
                                                        00b：SRC.Open（Open, Rp）
                                                        01：SRC.Ra（在vRa最大值以下）
                                                        10b：SRC.Rd（在vRd范围之内）
                                                        11b：预留
                                                        
                                                        当CC1为Rd下拉，则值为：
                                                        00b：SNK.Open（在vRa最大值以下）
                                                        01b：SNK.Default（在vRd-Connect最小值以上）
                                                        10b：SNK.Power1.5（在vRd-Connect最小值以上检测到Rp 1.5A）
                                                        11b：SNK.Power3.0（在vRd-Connect最小值以上检测到Rp 3.0A）
                                                        
                                                        另外，设置pd_cc1_cfg为Ra或者Open，则为0；
                                                        在pd_look4con为1时候，该比特状态为0；
                                                        默认00b */
        unsigned char  pd_cc2_stat   : 2;  /* bit[2-3]: CC2通路状态，
                                                        当CC2为Rp上拉，则值为：
                                                        00b：SRC.Open（Open, Rp）
                                                        01：SRC.Ra（在vRa最大值以下）
                                                        10b：SRC.Rd（在vRd范围之内）
                                                        11b：预留
                                                        
                                                        当CC2为Rd下拉，则值为：
                                                        00b：SNK.Open（在vRa最大值以下）
                                                        01b：SNK.Default（在vRd-Connect最小值以上）
                                                        10b：SNK.Power1.5（在vRd-Connect最小值以上检测到Rp 1.5A）
                                                        11b：SNK.Power3.0（在vRd-Connect最小值以上检测到Rp 3.0A）
                                                        
                                                        另外，设置pd_cc2_cfg为Ra或者Open，则为0；
                                                        在pd_look4con为1时候，该比特状态为0；
                                                        默认00b */
        unsigned char  pd_con_result : 1;  /* bit[4-4]: 0b：TCPC目前状态为双Rp上拉；
                                                        1b：TCPC目前状态为双Rd下拉；
                                                        默认1 */
        unsigned char  pd_look4con   : 1;  /* bit[5-5]: 0b：TCPC不在检测有效连接
                                                        1b：TCPC正在检测有效连接；
                                                        当pd_look4con发生1到0的变化，意味着检测到潜在的连接。
                                                        默认0 */
        unsigned char  reserved      : 2;  /* bit[6-7]:  */
    } reg;
} REG_PD_CC_STATUS_UNION;
#endif
#define REG_PD_CC_STATUS_pd_cc1_stat_START    (0)
#define REG_PD_CC_STATUS_pd_cc1_stat_END      (1)
#define REG_PD_CC_STATUS_pd_cc2_stat_START    (2)
#define REG_PD_CC_STATUS_pd_cc2_stat_END      (3)
#define REG_PD_CC_STATUS_pd_con_result_START  (4)
#define REG_PD_CC_STATUS_pd_con_result_END    (4)
#define REG_PD_CC_STATUS_pd_look4con_START    (5)
