/*****************************************************************************
 结构名    : REG_PD_FAULT_STATUS_UNION
 结构说明  : PD_FAULT_STATUS 寄存器结构定义。地址偏移量:0x1F，初值:0x80，宽度:8
 寄存器说明: PD Fault Status
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  pd_i2c_err           : 1;  /* bit[0-0]: I2C总线Error
                                                               0b：没有错误发生；
                                                               1b：I2C配置错误发生；
                                                               当配置Transmit触发发送SOP*类型msg的时候，若TX buffer cnt小于2，则上报I2C Error
                                                               默认0 */
        unsigned char  pd_cc_fault          : 1;  /* bit[1-1]: 华为自定义中断：芯片作为Snk，检测到对端插入且CC1或CC2电平超出PWR3.0（非标线缆），上报pd_cc_fault中断，不上报PD_CC_STATUS中断
                                                               0：没有CC Fault中断发生
                                                               1：有CC Fault中断发生
                                                               默认0 */
        unsigned char  pd_vusb_ovp          : 1;  /* bit[2-2]: VBUS OVP由系统中断上报（IRQ_FLAG_0.irq_vbus_ovp），这里不上报。 */
        unsigned char  reserved_0           : 1;  /* bit[3-3]: VBUS OCP no use */
        unsigned char  pd_force_disch_fail  : 1;  /* bit[4-4]: 0b：force放电没有失败；
                                                               1b：force放电失败。当PD_PWR_CTRL中的pd_force_disch_en设置为1且pd_disch_timer_dis设置为0，则在tSave0v（默认400ms）内VBUS电压没有下降到vSafe0v，则上报自动放电失败。 */
        unsigned char  pd_auto_disch_fail   : 1;  /* bit[5-5]: 0b：自动放电没有失败；
                                                               1b：自动放电失败。当PD_PWR_CTRL中的pd_auto_disch设置为1，且pd_disch_timer_dis设置为0，则在拔出时候，如果在tSave0v（默认400ms）内VBUS电压没有下降到vSafe0v，则上报自动放电失败。
                                                               默认0 */
        unsigned char  reserved_1           : 1;  /* bit[6-6]: 原协议为Force Off Vbus，本芯片不支持。 */
        unsigned char  pd_reg_reset_default : 1;  /* bit[7-7]: 当TCPC芯片所有与PD协议相关的寄存器被复位至默认值，该比特置1。否则为0。不可屏蔽。这会在power up初始化或者异常上电复位的时候发生。 */
    } reg;
} REG_PD_FAULT_STATUS_UNION;
#endif
#define REG_PD_FAULT_STATUS_pd_i2c_err_START            (0)
#define REG_PD_FAULT_STATUS_pd_i2c_err_END              (0)
#define REG_PD_FAULT_STATUS_pd_cc_fault_START           (1)
#define REG_PD_FAULT_STATUS_pd_cc_fault_END             (1)
